        "title": "THE 11 FIRST TRICKS TO LEARN ON SKIS",
        "description": "In this ski tutorial, we show you a progression on how to do 11 beginner ski tricks in an easy and fun way. Learn this in person at one of our camps https://stompittutorials.com/camps/. We start out teaching you how to pop on skis and once you got that key skill down that you will need for everything else we look into how to jump on skis or straight air as it’s called. To develop the right timing in the air to learn grabs later on we first learn to do a spreadie. We then continue developing key tricks and skills like how to ski switch which then leads us to do both 180s on skis and switch 180s. Lastly, we teach you how to do basic nose and tail butters plus your first box and grind tricks.\n\nLearn from us in reality at our camps:\nhttps://stompittutorials.com/camps/\n\nOur most in-depth tutorials can be found here: https://stompittutorials.com/beginner/\n\n00:00 Intro\n00:49 Trick 1: How to pop on skis\n01:56 Trick 2: How to jump on skis (straight air)\n02:53 Trick 3: How to spreadie on skis\n03:46 Trick 4: How to ski switch\n05:00 Trick 5: How to 180 on skis\n07:05 Trick 6: How to nose butter on skis\n08:13 Trick 7: How to switch 180 on skis\n08:59 Trick 8: How to tail butter on skis\n10:25 Trick 9: How to 5050 on a box\n11:25 Trick 10: How to box slide to switch on skis\n12:42 Trick 11: How to box slide to forwards\n\nFollow us on: \nStay in touch by email: http://eepurl.com/co7xaX\nIG: https://www.instagram.com/stompittutorials/\nTikTok: https://www.tiktok.com/@stompittutorials\nFB: https://www.facebook.com/stompittutorials/",
